import React from "react";
import BabyNamesData from "./BabyNamesData.js";
import data from "./data.json";

function BabyList(names) {
  return (
    <div>
      <h1>hey</h1>
      <ul>
        {names.map(({name }, key) => (
          <li>{name}</li>
        ))}
      </ul>
    </div>
  );
}

export default BabyList;
